import React from 'react';


export default function ExtendedTableRow(props){  
    return (   
        <div style={style.container}>
           <div style={style.childContent}>
                <h1 style>Produto Comprado</h1>
           </div>
        </div>
 

    )
}


const style = {
    container: {
        backgroundColor: "#a1a1a1",
        width: "100%",
        height: "400px"
    },

    childContent: {
        width: "500px",
        right: "500px",
        backgroundColor: "black"
        
    }

};
